-- ----------------------------
-- Table structure for clips
-- ----------------------------
DROP TABLE IF EXISTS `clips`;
CREATE TABLE `clips`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `name` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '帧文件名称',
  `video_id` bigint(20) NULL DEFAULT NULL COMMENT '视频ID',
  `frame_num` int(10) NULL DEFAULT NULL COMMENT '帧数',
  `address` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '帧文件地址',
  `xml_address` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'XML文件地址',
  `tag` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '标签JSON',
  `tagged` int(1) NULL DEFAULT 0 COMMENT '是否已标注,0未标注，1标注中，2已标注',
  `tag_date` datetime(0) NULL DEFAULT NULL,
  `tagger` int(20) NULL DEFAULT NULL COMMENT '标注者ID',
  `is_deleted` int(1) NULL DEFAULT 0 COMMENT '是否删除，0：未删除；1：已删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1104346676118712322 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

